  //----------------------------------------------------------------------------
  double init$rms_process (
    double  s0,
    double  s1,
    double& $rms_sum,
    double& $rms_prev_val,
    double& $rms_buffer,
    double& $rms_bufidx,
    double& $rms_max_count)
  {
    double rms_ampr = 0.;
    double rms_amp  = 0.;
    double rms_ampl = 0.;
    rms_ampl        = std::fabs (s0);
    rms_ampr        = std::fabs (s1);
    if (rms_ampl < 0.0000001) {
      rms_ampl = 0.0000001;
    }
    if (rms_ampr < 0.0000001) {
      rms_ampr = 0.0000001;
    }
    rms_amp = (rms_ampl * rms_ampl + rms_ampr * rms_ampr) * 0.5;
    $rms_sum += rms_amp;
    $rms_prev_val                    = heap ($rms_buffer + $rms_bufidx);
    heap ($rms_buffer + $rms_bufidx) = rms_amp;
    $rms_bufidx += 1.;
    if (eel2_eq ($rms_bufidx, $rms_max_count)) {
      ($rms_bufidx = 0.);
    }
    $rms_sum -= $rms_prev_val;
    return [&] {
      if ($rms_sum < 0.) {
        $rms_sum = 0.0;
        return $rms_sum;
      }
      else {
        return 0. / 0.;
      }
    }();
  }
