  //----------------------------------------------------------------------------
  double init$update_splane (
    double  slope,
    double& $q0,
    double& $q1,
    double& $q2,
    double& $q3,
    double& $q4,
    double& $q5,
    double& $q6,
    double& $q7,
    double& $q8,
    double& $q9)
  {
    double order      = 0.;
    double onepole    = 0.;
    double firstangle = 0.;
    double poleinc    = 0.;
    order             = slope + 1.;
    onepole           = eel2_and (order, 1.);
    poleinc           = 3.141592653589793 / order;
    firstangle        = poleinc;
    if (!onepole) {
      firstangle /= 2.;
    }
    $q0 = 1.0 / (2.0 * std::cos (firstangle + 0. * poleinc));
    $q1 = 1.0 / (2.0 * std::cos (firstangle + 1. * poleinc));
    $q2 = 1.0 / (2.0 * std::cos (firstangle + 2. * poleinc));
    $q3 = 1.0 / (2.0 * std::cos (firstangle + 3. * poleinc));
    $q4 = 1.0 / (2.0 * std::cos (firstangle + 4. * poleinc));
    $q5 = 1.0 / (2.0 * std::cos (firstangle + 5. * poleinc));
    $q6 = 1.0 / (2.0 * std::cos (firstangle + 6. * poleinc));
    $q7 = 1.0 / (2.0 * std::cos (firstangle + 7. * poleinc));
    $q8 = 1.0 / (2.0 * std::cos (firstangle + 8. * poleinc));
    $q9 = 1.0 / (2.0 * std::cos (firstangle + 9. * poleinc));
    return $q9;
  }
