  double init$zdf_is_resting (double& $iter_t, double& $onepole)
  {
    double resting = 0.;
    resting        = eel2_eq ($iter_t, 1.0);
    if (nlp > 2.) {
      resting = eel2_or (resting, eel2_eq (cas1$iter_t, 1.0));
      if (nlp > 4.) {
        resting = eel2_or (resting, eel2_eq (cas2$iter_t, 1.0));
        if (nlp > 6.) {
          resting = eel2_or (resting, eel2_eq (cas3$iter_t, 1.0));
          if (nlp > 8.) {
            resting = eel2_or (resting, eel2_eq (cas4$iter_t, 1.0));
            if (nlp > 10.) {
              resting = eel2_or (resting, eel2_eq (cas5$iter_t, 1.0));
              if (nlp > 12.) {
                resting = eel2_or (resting, eel2_eq (cas6$iter_t, 1.0));
                if (nlp > 14.) {
                  resting = eel2_or (resting, eel2_eq (cas7$iter_t, 1.0));
                  if (nlp > 16.) {
                    resting = eel2_or (resting, eel2_eq (cas8$iter_t, 1.0));
                    if (nlp > 18.) {
                      (resting = eel2_or (resting, eel2_eq (cas9$iter_t, 1.0)));
                    }
                  }
                }
              }
            }
          }
        }
      }
    }
    return resting || $onepole;
  }
