  //----------------------------------------------------------------------------
  double init$zdf_onepole (
    double  mode,
    double  cutoff,
    double& $passtype,
    double& $b0,
    double& $b1,
    double& $a1)
  {
    double w  = 0.;
    double n  = 0.;
    $passtype = mode;
    return [&] {
      if (eel2_eq ($passtype, 0.)) {
        w   = std::tan (3.141592653589793 * cutoff / sample_rate);
        n   = 1. / (1. + w);
        $b0 = w * n;
        $b1 = $b0;
        $a1 = n * (w - 1.);
        return $a1;
      }
      else {
        w   = std::tan (3.141592653589793 * cutoff / sample_rate);
        n   = 1. / (1. + w);
        $b0 = n;
        $b1 = -$b0;
        $a1 = n * (w - 1.);
        return $a1;
      }
    }();
  }
  //----------------------------------------------------------------------------
  double init$zdf_onepole_do (
    double  in,
    double& $acc,
    double& $b0,
    double& $z0,
    double& $b1,
    double& $z1,
    double& $a1)
  {
    $acc = in * $b0 + $z0 * $b1 - $z1 * $a1;
    $z1  = $acc;
    $z0  = in;
    return $acc;
  }
