  //----------------------------------------------------------------------------
  double init$zdf_single_interpolate (
    double& $iter_t,
    double& $a1,
    double& $s_a1,
    double& $t_a1,
    double& $a2,
    double& $s_a2,
    double& $t_a2,
    double& $a3,
    double& $s_a3,
    double& $t_a3,
    double& $m0,
    double& $s_m0,
    double& $t_m0,
    double& $m1,
    double& $s_m1,
    double& $t_m1,
    double& $m2,
    double& $s_m2,
    double& $t_m2,
    double& $iter_step)
  {
    return [&] {
      if ($iter_t < 1.0) {
        $a1     = $s_a1 + $iter_t * ($t_a1 - $s_a1);
        $a2     = $s_a2 + $iter_t * ($t_a2 - $s_a2);
        $a3     = $s_a3 + $iter_t * ($t_a3 - $s_a3);
        $m0     = $s_m0 + $iter_t * ($t_m0 - $s_m0);
        $m1     = $s_m1 + $iter_t * ($t_m1 - $s_m1);
        $m2     = $s_m2 + $iter_t * ($t_m2 - $s_m2);
        $iter_t = std::min (1.0, $iter_t + $iter_step);
        return $iter_t;
      }
      else {
        $a1 = $t_a1;
        $a2 = $t_a2;
        $a3 = $t_a3;
        $m0 = $t_m0;
        $m1 = $t_m1;
        $m2 = $t_m2;
        return $m2;
      }
    }();
  }
